comment:
ㅋㅋㅋㅋㅋ 저런애 딱싫음
지가 다른사람보다 잘난거 자기가 알고 따라해서 자기가 더 돋보이게 하는 방식. 꼭 저런애 한명씩 있음 
이 얘기듣고 찔린사람은 반성좀해요;

때탄 파워에이드라뇨 베댓님..
파워에이드가 훨씬낫죠 저 발암싴히는
재활용 할 수 도 없습니다;

사람 좋아하는데 이유가 있나...
웃자고한 얘기에 기분나빠서 발끈하는건 알겠는데
하나뿐인 친구 욕하지는 말자;
걔까지 잃으면 친구없는 너인데 지무덤을 파는 파랑머리는
ㄹㅇ 도덕책;

지 잘못한 거 모르고
딴 사람 잘못만 밉네 마네 하네 진짜..;;
글고 저 친구 니 정도 밖에 안 되는 애 옆에 있어준게 장하다
